import React from "react";

export const CreateProject = () => {
  return (
    <div>
      <h1 class="title">Create Project</h1>
      <div>
        <div className="field">
          <label className="label">Project Name</label>
          <div className="control">
            <input
              className="input is-success"
              type="text"
              placeholder="Text input"
            />
          </div>
        </div>
      </div>
    </div>
  );
};
